description:
MilfLikeItBig - Julia Ann - Picocksso


Julia was a well respected painter, but recently hasn't sold any paintings in a while. When her agent comes over to discuss her career, he gets a peek of her latest painting, but she refuses to sell it because she claims it's too personal. However, after Julia catches a glimpse of Keiran'cock, she is more than willing to exchange the painting for the real thing.

